My friend Laney Fox and 8 other women have filed a lawsuit against Lenoir-Rhyne University, Frederick Whitt, and Grahm Smith. I have previously posted about this situation and will continue to shed light on it. Everyone has a voice they can use and it is important to call out all situations of injustice. This is a fight for equality and equity for ALL PEOPLE.

